Angelica Heart is behind bars. A well earned punishment, but still, she would do anything to regain her freedom. Meanwhile, on the other side of the law there is the not less kinky Honey Demon. The gorgeous jailer may have a few tricks which could get the charges against Angelica dropped, but as usual, she expects a payment for that. The inmate has everything to fulfill her own part of the bargain, she only needs to pay now...
